import React, { useCallback, useState } from "react";

function FollowerList({ header, data }) {
  const as = 100;
  const [Value, setState] = useState("");
  const test = useCallback(() => {
    setState(value);
  }, [as]);
  return (
    <>
      <input value={Value} onChange={test} />
    </>
  );
}

export default FollowerList;
